import React, { Component } from 'react';
import { connect } from 'react-redux'

import { fetchingUserData } from '../../redux/actions/users.js'

class TransferHome extends Component {
  componentDidMount() {
    this.props.fetchingUserData(this.props.id)
  }

  render() {
    return(
      <div>
        Transfers Home
      </div>
    )
  }
}

const mapStateToProps = state => {
  return {
    user_id: state.user.id,
    username: state.user.username,
    first_name: state.user.first_name,
    last_name: state.user.last_name,
    sessions: state.user.sessions
  }
}

export default connect(mapStateToProps, { fetchingUserData })(TransferHome);
